const FiltroPesquisa = (props) => {

    const Tabs = () => {
        const tab = props.tab
        const [activeTab, setActiveTab] = useState({ tab });
    }


    return (<div>
        <li ><a href={props.tab}>{props.label} </a></li>

    </div>);
}

